public void lookup()
{
    Query                   query = new Query();
    QueryBuildDataSource    queryBuildDataSource;
    QueryBuildRange         queryBuildRange1;
    QueryBuildRange         queryBuildRange2;

    ItemId itemFilter = itemIdMain.valueStr();

    SysTableLookup sysTableLookup = SysTableLookup::newParameters(tableNum(ProdTable), this);

    sysTableLookup.addLookupField(fieldNum(ProdTable, PIPBatchProdId));
    sysTableLookup.addLookupField(fieldNum(ProdTable, ProdId));

    if (!prodId)
    {
        sysTableLookup.addLookupfield(fieldNum(ProdTable, ItemId));
    }

    queryBuildDataSource = query.addDataSource(tableNum(ProdTable));

    queryBuildDataSource.addSortField(fieldNum(ProdTable, PIPBatchProdId));

    queryBuildRange1 = queryBuildDataSource.addRange(fieldNum(ProdTable, PIPBatchProdId));
    queryBuildRange1.value(SysQuery::valueNotEmptyString());

    if (itemFilter)
    {
        queryBuildRange2 = queryBuildDataSource.addRange(fieldNum(ProdTable, ItemId));
        queryBuildRange2.value(queryValue(itemFilter));
    }

    sysTableLookup.parmQuery(query);

    sysTableLookup.performFormLookup();
}

public boolean modified()
{
    ProdTable   prod;
    boolean     ret;

    ret = super();

    element.parmBatchProdId(this.valueStr());

    select firstOnly prod
        where prod.PIPBatchProdId == this.valueStr();

    if (prod)
    {
        itemId = prod.ItemId;
        prodId = prod.ProdId;
        element.OnProdTableChanged(this, prod);
    }

    element.parmItemId(itemId);
    itemIdMain.text(itemId);
    element.updateDesign(InventDimFormDesignUpdate::FieldChange);

    prodTable_ds.executeQuery();
    bomVersion_ds.executeQuery();
    routeVersion_ds.executeQuery();

    return ret;
}

public boolean validate()
{
    boolean ret;

    ret = super();

    if (!this.valueStr())
    {
        ret = error(strFmt("@SYS26332", fieldId2PName(tableNum(ProdTable), fieldNum(ProdTable, PIPBatchProdId))));
        this.text(element.parmBatchProdId());
    }           

    return ret;
}

